// Header.js
import React from 'react';
import '../styles/Header.css'; 
import ShelterLinkLogo from '../../public/images/ShelterLink.png'; // Import the logo image

function Header() {
  return (
    <header className="header">
      {/* Logo */}
      <div className="logo">
        <img src={ShelterLinkLogo} alt="ShelterLink Logo" />
      </div>

      <nav className="main-navigation">
        {/* ... (navigation code) */}
      </nav>

      <div className="user-profile">
        {/* ... (user profile code) */}
      </div>

      {/* ... (search bar and background code) */}
    </header>
  );
}

export default Header;
